import React from 'react';
import {Link} from "react-router-dom";
import axios from 'axios';

const {useReducer} = React;

function reducer(state, action) {
    switch (action.type) {
        case 'email' : {
            return {
                ...state, email: action.payload
            }
        }
        case 'pas': {
            return {
                ...state, password: action.payload
            }
        }
        default : {
            return {...state};
        }
    }
}

export default function RegPage(props) {

    const initState = {
        email: null,
        password: null
    };


    const [state, dispatch] = useReducer(reducer, initState);

    const onChange = (type, data) => {
        dispatch({type: type, payload: data});
    };

    const reg = () => {
        let data = {
            email: state.email,
            password: state.password
        };
        axios.post('/reg', data)
            .then(() => {
                props.history.push('/login')
            })
            .catch((er) => {
                props.history.push('/reg');
                console.log(er);
                alert('Some error');
            })
    };

    return (
        <div>
            <div className={'reg'}>
                <input className={'text-input'} type={'text'} name={"email"} id={"email"}
                       onChange={(event) => onChange('email', event.target.value)}/>
                <label className={'log-label'}>Password</label>
                <br/>
                <input className={'text-input'} type={'password'} name={"password"} id={"password"}
                       onChange={(event) => onChange('password', event.target.value)}/>
                <Link to={'/login'} className={"log-reg-btn"}>To log in</Link>
                <button className={"log-reg-btn"} onClick={() => reg()}>Sign up</button>
            </div>
        </div>);
}
